// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

contract SchoolManagement {
    address public owner;

    enum Role { Student, Staff }

    struct Student {
        string name;
        uint256 classLevel;
        uint256 feesPaid;
        bool isRegistered;
    }

    struct Staff {
        string name;
        string position;
        bool isRegistered;
    }

    mapping(address => Student) public students;
    mapping(address => Staff) public staff;

    event StudentRegistered(address indexed student, string name, uint256 classLevel);
    event StaffRegistered(address indexed staff, string name, string position);
    event FeesPaid(address indexed student, uint256 amount);

    modifier onlyOwner() {
        require(msg.sender == owner, "Only the administrator can perform this action");
        _;
    }

    modifier onlyRegisteredStudent() {
        require(students[msg.sender].isRegistered, "Only registered students can perform this action");
        _;
    }

    constructor() {
        owner = msg.sender;
    }

    // Register a student
    function registerStudent(address _student, string memory _name, uint256 _classLevel) public onlyOwner {
        require(!students[_student].isRegistered, "The student is already registered");

        students[_student] = Student({
            name: _name,
            classLevel: _classLevel,
            feesPaid: 0,
            isRegistered: true
        });

        emit StudentRegistered(_student, _name, _classLevel);
    }

    // Register a staff member
    function registerStaff(address _staff, string memory _name, string memory _position) public onlyOwner {
        require(!staff[_staff].isRegistered, "This staff member is already registered");

        staff[_staff] = Staff({
            name: _name,
            position: _position,
            isRegistered: true
        });

        emit StaffRegistered(_staff, _name, _position);
    }

    // Student pays school fees
    function payFees() public payable onlyRegisteredStudent {
        require(msg.value > 0, "The amount must be greater than 0");

        students[msg.sender].feesPaid += msg.value;

        emit FeesPaid(msg.sender, msg.value);
    }

    // Get the total amount of fees paid by a student
    function getStudentFeesPaid(address _student) public view returns (uint256) {
        require(students[_student].isRegistered, "This student is not registered");
        return students[_student].feesPaid;
    }

    // Withdraw collected funds (only the administrator can perform this action)
    function withdrawFunds() public onlyOwner {
        payable(owner).transfer(address(this).balance);
    }

    // Check the contract balance
    function getContractBalance() public view returns (uint256) {
        return address(this).balance;
    }
}

